    try {
        let entidades = await Proveedor.findAll({
            attributes: [
                ['proveedorid', 'id'],
                ['nombre', 'descripcion']
            ]
        });
        //console.log(entidades)
        if (entidades) {
            return res.status(200).json({
                data: entidades
            });
        }
    } catch (e) {
        console.log(e.message)
        return res.status(500).json({
            message: 'Algo salio mal',
            data: {}
        });
    }
};
