import { json, where } from 'sequelize';
import Usuariosubmenu from '../models/usuariosubmenu.model';
import Submenu from '../models/submenu.model';
import Menu from '../models/menu.model';
import Usuario from '../models/usuario.model';
export async function getUsuariosubmenus(req, res) {
    try {
        let entidad = await Usuariosubmenu.findAll({
            attributes: ['id', 'usuarioid', 'submenuid'],
            include: [{
                    attributes: ['submenuid', 'menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                    model: Submenu,
                    as: 'submenu',
                    required: true,
                    include: [{
                        attributes: ['menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                        model: Menu,
                        as: 'menu',
                        required: true
                    }]
                }, {
                    attributes: ['submenuid', 'menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                    model: Submenu,
                    as: 'submenu',
                    required: true
                },
                {
                    attributes: ['usuarioid', 'usuario', 'descripcion', 'correo'],
                    model: Usuario,
                    as: 'usuario',
                    required: true,
                }
            ]
        });
        console.log(entidad)
        if (entidad) {
            return res.status(200).json({
                data: entidad
            });
        }
    } catch (e) {
        console.log(e.message);
        return res.status(500).json({
            message: 'Algo salio mal',
            data: {}
        });
    }
};

export async function getUsuariosubmenusUsuario(req, res) {
    const { usuarioid } = req.body;
    try {
        let entidad = await Usuariosubmenu.findAll({
            attributes: ['id', 'usuarioid', 'submenuid'],
            include: [{
                    attributes: ['submenuid', 'menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                    model: Submenu,
                    as: 'submenu',
                    required: true,
                    include: [{
                        attributes: ['menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                        model: Menu,
                        as: 'menu',
                        required: true
                    }]
                }, {
                    attributes: ['submenuid', 'menuid', 'titulo', 'descripcion', 'icono', 'ruta'],
                    model: Submenu,
                    as: 'submenu',
                    required: true
                },
                {
                    attributes: ['usuarioid', 'usuario', 'descripcion', 'correo'],
                    model: Usuario,
                    as: 'usuario',
                    required: true,
                }
            ],
            where: {
                usuarioid: usuarioid
            }
