import {
    json,
    where
} from 'sequelize';
import Cliente from '../models/cliente.model';
import Ubigeo from '../models/ubigeo.model';
import Sequelize from 'sequelize';
import sequelize from 'sequelize';
const Op = Sequelize.Op;
import Sellout from '../models/sellout.model'
import Selloutmes from '../models/selloutmes.model';
export async function getClientes(req, res) {
    try {
        let entidades = await Cliente.findAll({
            attributes: ['id', 'clienteid', 'unidadnegocioid', 'ruc', 'razonsocial', 'nombrecomercial', 'zonaid', 'ubigeoid', 'direccion'],
            include: [{
                attributes: ['id', 'ubigeoid', 'nombre', 'departamentoid', 'provinciaid', 'distritoid', 'departamento', 'provincia'],
                model: Ubigeo,
                as: 'ubigeo',
                required: true
            }]
        });
        //console.log(entidades)
        if (entidades) {
            return res.status(200).json({
                data: entidades
            });
        } else {
            return res.status(200).json({
                data: {}
            });
        }
    } catch (e) {
        return res.status(500).json({
            message: 'Algo salio mal',
            data: {}
        });
    }
};
export async function getClientesPage(req, res) {
    const {
        limite,
        pagina
    } = req.body;
    try {
        let entidades = await Cliente.findAll({
            attributes: ['id', 'clienteid', 'unidadnegocioid', 'ruc', 'razonsocial', 'nombrecomercial', 'zonaid', 'ubigeoid', 'direccion'],
            include: [{
                attributes: ['id', 'ubigeoid', 'nombre', 'departamentoid', 'provinciaid', 'distritoid', 'departamento', 'provincia'],
                model: Ubigeo,
                as: 'ubigeo',
                required: true
            }],
            limit: limite,
            offset: pagina
        });
        //console.log(entidades)
        if (entidades) {
            return res.status(200).json({
                data: entidades
            });
        } else {
            return res.status(200).json({
                data: {}
            });
        }
    } catch (e) {
        return res.status(500).json({
            message: 'Algo salio mal',
            data: {}
        });
    }
};

export async function getClientesUbigeoPage(req, res) {
    const {
        limite,
        pagina,
        ubigeoid
    } = req.body;
    try {
        let entidades = await Cliente.findAll({
            attributes: ['id', 'clienteid', 'unidadnegocioid', 'ruc', 'razonsocial', 'nombrecomercial', 'zonaid', 'ubigeoid', 'direccion'],
            include: [{
                attributes: ['id', 'ubigeoid', 'nombre', 'departamentoid', 'provinciaid', 'distritoid', 'departamento', 'provincia'],
                model: Ubigeo,
                as: 'ubigeo',
                required: true
            }],
            where: {
                ubigeoid: ubigeoid
            },
            limit: limite,
            offset: pagina
        });
        //console.log(entidades)
        if (entidades) {
            return res.status(200).json({
                data: entidades
            });
        } else {
            return res.status(200).json({
                data: {}
            });
        }
    } catch (e) {
        return res.status(500).json({
            message: 'Algo salio mal',
            data: {}
        });
    }
};
export async function getClientesZonaPage(req, res) {
    const {
        limite,
        pagina,
        zonaid
    } = req.body;
    try {
        let entidades = await Cliente.findAll({
            attributes: ['id', 'clienteid', 'unidadnegocioid', 'ruc', 'razonsocial', 'nombrecomercial', 'zonaid', 'ubigeoid', 'direccion'],
            include: [{
                attributes: ['id', 'ubigeoid', 'nombre', 'departamentoid', 'provinciaid', 'distritoid', 'departamento', 'provincia'],
                model: Ubigeo,
                as: 'ubigeo',
                required: true
            }],
            where: {
                zonaid: zonaid
            },
            limit: limite,
            offset: pagina
        });
        //console.log(entidades)
        if (entidades) {
            return res.status(200).json({
